import React from 'react';
import { Link } from 'react-router-dom';
import { Navbar, Nav } from 'react-bootstrap';

export default class Navigation extends React.Component {

    constructor(props) {
        super(props);

        this.toggleNavbar = this.toggleNavbar.bind(this);
        this.state = {
          showNavbar: false
        };
      }
      toggleNavbar(e) {
        e.preventDefault();
        this.setState({
          showNavbar: !this.state.showNavbar
        });
      }

      handleSelect(selectedKey) {
        this.setState({activeKey: selectedKey});
      }

    render() {
        return <Navbar bg="light" expand="lg">
            <Navbar.Brand href="#home">React-Bootstrap</Navbar.Brand>
            <Navbar.Toggle aria-controls="basic-navbar-nav" onClick={this.toggleNavbar} />
            <Navbar.Collapse id="basic-navbar-nav">
                <Nav className="mr-auto" activeKey={this.state.activeKey} onSelect={this.handleSelect}>
                    <Nav.Link  tag={Link} eventKey={1} href="/">main</Nav.Link>
                    <Nav.Link  tag={Link} eventKey={2} href="/second">second</Nav.Link>
                    {/* <LinkContainer to="/">
                        <NavItem eventKey={1}>main</NavItem>
                    </LinkContainer> */}
                    {/* <LinkContainer to="/second">
                        <NavItem eventKey={2}>second</NavItem>
                    </LinkContainer>  */}
                </Nav>
            </Navbar.Collapse>
        </Navbar>
    }

}
